  //     title: "Car insurance",
  //     amount: 294.67,
  //   },
  // ];

  return (
    <div className="expense-item">
      <div>{expenseDate}</div>
      <div class="expense-item__description">
        <h2>{expenseTitle}</h2>
        <div class="expense-item__price">${expenseAmount}</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
